import { FieldType } from "./deserialization/FieldType";
import JsonDeserializationHelper from "./deserialization/JsonDeserializationHelper";

export class Room {
    readonly id : number;
    readonly bedArrangement : string;

    constructor(id : number, bedArrangement : string) {
        this.id = id;
        this.bedArrangement = bedArrangement;
    }

    static deserialize = (json : any) => {
        const id = JsonDeserializationHelper.assertField(json, 'id', FieldType.NUMBER);
        const bedArrangement = JsonDeserializationHelper.assertField(json, 'bedArrangement', FieldType.STRING);

        return new Room(id, bedArrangement);
    }
}
